import { Link } from "react-router-dom";
const Sidebar=()=>{
    return <div className="sidebar">
    <div className="sidebar_items">
    <Link to="/dashboard" className={location.pathname==='/dashboard'?'sidebar_active':'tab_inactive'}>Dashboard</Link>
    <Link to="/tabs" className={location.pathname==='/tabs'?'sidebar_active':'tab_inactive'}>Tabs Demo</Link>
    <Link to="/settings" className={location.pathname==='/settings'?'sidebar_active':'tab_inactive'}>Settings</Link>
    </div>

    </div>;
}

export default Sidebar
